import React from 'react';
import './App.css';
import { Route} from 'react-router-dom'
import EmployeeList from './websites/List';
import AddEmployee from './websites/Add';
import ViewEmployees from './websites/view';
import NavigationBar from './components/Navigation';
import UpdateEmployee from './websites/Update';


function App() {
  return (
    <div style={{paddingTop:50}}>
      <NavigationBar/>
      <div className="container">
        <div>
          <div> 
            <Route exact path = "/" component={EmployeeList}></Route>
            <Route exact path = "/employees" component={EmployeeList}></Route>
            <Route path = "/add" component={AddEmployee}></Route>
            <Route path = "/view/:id" component={ViewEmployees}></Route>
            <Route path = "/update/:id" component={UpdateEmployee}></Route>
          </div>
        </div>
      </div>
    </div>

  );
}

export default App;
